const BodyOne = () => {
    return (
        <div className="row">
            <div className="col-md-2">
                <div className="bg-light d-flex align-items-center justify-content-center boxMakingFor" style={{width:'100%', height:'100%'}}>
                    <img style={{maxWidth:'94%', maxHeight:'94%', borderRadius}} src="https://images.unsplash.com/photo-1548345680-f5475ea5df84?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8bG9jYXRpb258ZW58MHx8MHx8&ixlib=rb-1.2.1&w=1000&q=80" alt="" />
                </div>
            </div>
            <div className="col-md-5">
                <div className="bg-light boxMakingFor">
                    <h1>Hello world</h1>
                </div>
            </div>
            <div className="col-md-5">
                <div className="bg-light boxMakingFor">
                    <h1>Hello world</h1>
                </div>
            </div>
        </div>
    );
};

export default BodyOne;
